// client/src/components/ResidentDetail.js (updated)
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { calculateAge, formatDate } from '../utils/helpers';

const ResidentDetail = ({ navigateTo, residentId }) => {
  const [resident, setResident] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    if (residentId) {
      fetchResidentDetail();
    }
  }, [residentId]);

  const fetchResidentDetail = async () => {
    try {
      const response = await axios.get(`/api/residents/${residentId}`);
      setResident(response.data);
    } catch (error) {
      console.error('Error fetching resident detail:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="page-wrapper">
        <div className="text-center py-5">
          <div className="spinner-border text-primary" role="status">
            <span className="visually-hidden">Loading...</span>
          </div>
        </div>
      </div>
    );
  }

  if (!resident) {
    return (
      <div className="page-wrapper">
        <button className="btn btn-back" onClick={() => navigateTo('list')}>
          <i className="fas fa-arrow-left"></i> Kembali ke Daftar
        </button>
        <div className="text-center py-5">
          <h3>Data penghuni tidak ditemukan</h3>
        </div>
      </div>
    );
  }

  const age = calculateAge(resident.birth_date);
  const genderIcon = resident.gender === 'L' ? 'fa-male' : 'fa-female';
  const type = resident.gender === 'L' ? 'Opa' : 'Oma';
  const genderText = resident.gender === 'L' ? 'Laki-laki' : 'Perempuan';

  return (
    <div className="page-wrapper">
      <button className="btn btn-back" onClick={() => navigateTo('list')}>
        <i className="fas fa-arrow-left"></i> Kembali ke Daftar
      </button>

      <div className="detail-header">
        <div className="detail-avatar">
          <i className={`fas ${genderIcon}`}></i>
        </div>
        <h2 style={{ margin: 0, fontSize: '2.2rem' }}>{resident.name}</h2>
        <p style={{ margin: '10px 0 0 0', fontSize: '1.1rem', opacity: 0.95 }}>
          {type} â€¢ {age || '?'} Tahun
        </p>
      </div>

      {/* Data Pribadi */}
      <div className="info-section">
        <h5><i className="fas fa-user"></i> Data Pribadi</h5>
        <div className="info-row">
          <div className="info-label">Nama Lengkap:</div>
          <div className="info-value">{resident.name}</div>
        </div>
        <div className="info-row">
          <div className="info-label">Umur:</div>
          <div className="info-value">{age || 'Tidak diketahui'} Tahun</div>
        </div>
        <div className="info-row">
          <div className="info-label">Tanggal Lahir:</div>
          <div className="info-value">{formatDate(resident.birth_date) || '-'}</div>
        </div>
        <div className="info-row">
          <div className="info-label">Jenis Kelamin:</div>
          <div className="info-value">{genderText}</div>
        </div>
        {/* ... rest of the detail page remains */}
      </div>
      {/* ... rest of the component */}
    </div>
  );
};

export default ResidentDetail;
